import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AddProduct.css';
import { ReactComponent as BackIcon } from '../assets/back-icon.svg';

function AddProduct() {
  const navigate = useNavigate();
  
  const [productData, setProductData] = useState({
    code: '',
    product: '',
    category: '',
    country: '',
    status: 'Activo',
    lastEvaluation: '',
    tariffCode: '',
    risk: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProductData({
      ...productData,
      [name]: value
    });
  };

  const handleGoBack = () => {
    navigate(-1);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you would save the new product
    console.log('New product data:', productData);
    navigate('/productos');
  };

  return (
    <div className="add-product-container">
      <form className="add-product-card" onSubmit={handleSubmit}>
        <div className="product-grid">
          <div className="product-item">
            <label htmlFor="code">Código:</label>
            <input
              type="text"
              id="code"
              name="code"
              value={productData.code}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="product-item">
            <label htmlFor="status">Estado:</label>
            <input
              type="text"
              id="status"
              name="status"
              value={productData.status}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="product-item">
            <label htmlFor="product">Producto:</label>
            <input
              type="text"
              id="product"
              name="product"
              value={productData.product}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="product-item">
            <label htmlFor="lastEvaluation">Última evaluación:</label>
            <input
              type="text"
              id="lastEvaluation"
              name="lastEvaluation"
              value={productData.lastEvaluation}
              onChange={handleChange}
            />
          </div>
          
          <div className="product-item">
            <label htmlFor="category">Categoría:</label>
            <input
              type="text"
              id="category"
              name="category"
              value={productData.category}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="product-item">
            <label htmlFor="tariffCode">Código arancelario:</label>
            <input
              type="text"
              id="tariffCode"
              name="tariffCode"
              value={productData.tariffCode}
              onChange={handleChange}
            />
          </div>
          
          <div className="product-item">
            <label htmlFor="country">País:</label>
            <input
              type="text"
              id="country"
              name="country"
              value={productData.country}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="product-item">
            <label htmlFor="risk">Riesgo:</label>
            <input
              type="text"
              id="risk"
              name="risk"
              value={productData.risk}
              onChange={handleChange}
              required
            />
          </div>
        </div>
        
        <div className="product-actions">
          <button type="button" className="back-button" onClick={handleGoBack}>
            <BackIcon className="back-icon" />
            <span>Regresar</span>
          </button>
          
          <button type="submit" className="done-button">
            Hecho
          </button>
        </div>
      </form>
    </div>
  );
}

export default AddProduct;
